import React from "react";
import "./DayType.css";
import { Chart } from "react-google-charts";
import { useState, useEffect } from "react";
import { Col, Row, Spinner } from "react-bootstrap";
const DayType = () => {
  const [results, setResults] = useState([]);

  const dataType = [
    ["Type", "Type per Wine"],
    ["Dry", 12],
    [
      "Semi Dry",
    6
    ],
    [
      "Semi Sweet",
      results.length !== 0
        ? results.opinion.filter(function (e) {
            return e.Type == "semi sweet";
          }).length
        : 0,
    ],
    [
      "Sweet",
      results.length !== 0
        ? results.opinion.filter(function (e) {
            return e.Type == "sweet";
          }).length
        : 0,
    ],
  ];

  const optionsType = {
    title: `Wine & Type`,
    colors: ["#1f77b4", "#ff7f6e", "#d62728", "#2ca02c"],
  };
  return <div>DayType</div>;
};

export default DayType;
